import { components } from "react-select";

var copy = []

function copydata(data){
    console.log(data)
    
    for (let i = 0; i < data.length; i++) {
        copy.push(data[i])
       
    }
 
}

function receiveJSON(){


    fetch('http://localhost:3001/receiveJSON')
    .then(res =>res.json())
    .then(data =>  copydata(data))
    console.log(copy)

}

export default receiveJSON;
